package Generic.PointSimple;/** * Created by Tan on 2016/11/8. */public class Point<T> {    private T x;    private T y;    public T getX() {        return x;    }    public void setX(T x) {        this.x = x;    }    public T getY() {        return y;    }    public void setY(T y) {        this.y = y;    }    @Override    public String toString() {        return "Point{" +                "x=" + x +                ", y=" + y +                '}';    }}